import React from "react";
import styled from "styled-components";

const SignUp = () => {
  return (
    <React.Fragment>
      <Wrap>회원가입</Wrap>
    </React.Fragment>
  );
};

export default SignUp;

const Wrap = styled.div`
  width: 58rem;
  display: flex;
  flex-direction: row;
  justify-content: center;
`;

const SmallWrap = styled.div`
  width: 23rem;
  display: flex;
  flex-direction: column;
`;
